import React from 'react'
import { Button } from '@material-ui/core'

interface Props {
    aktiveBooking: boolean
    buttonPressedListener: any
}


export const BookingButton:  React.FC<Props> = (Props) => {

    if(Props.aktiveBooking){
        return (<div>
            <Button variant="outlined" onClick={Props.buttonPressedListener}>
                    Abbestellen
            </Button> 
        </div>)
    }

    return (<div>
        <Button variant="outlined" color="primary" onClick={Props.buttonPressedListener}>
                Reservieren
        </Button> 
    </div>)
}
